import React, { useState } from "react";
import { Button,Row,Col,ListGroup,Image,Card, ListGroupItem } from "react-bootstrap";
import { Link } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { useNavigate } from "react-router-dom";
import Message from  '../Components/Message';
import CheckoutStep from "../Components/CheckoutStep";
import { createOrder } from "../actions/orderActions";

const PlaceOrderScreen = () => {

  const dispatch = useDispatch();    

  const navigate = useNavigate();
  const cart = useSelector((state) => state.cart);
  cart.paymentMethod = "Paypal";
  
  //function for 2 decimal place
  const toDecimals = (num) => {
    return (Math.round(num*100) / 100).toFixed(2)
  }

  //Prices
  cart.itemsPrice = toDecimals(cart.cartItems.reduce((acc,item) => acc + item.price*item.qty , 0));
  cart.shippingPrice = toDecimals(cart.itemsPrice > 100 ? 0 : 10);
  cart.taxPrice = Number(0.18 * cart.itemsPrice).toFixed(2); 
  cart.totalPrice = Number(cart.itemsPrice) + Number(cart.shippingPrice) + Number(cart.taxPrice);

  const placeOrderHandler = (e) => {
    console.log("Order Placed");
  }

  cons

  return (
    <>
        <CheckoutStep step1 step2 step3 step4 />
        <Row>
            <Col md={8}>
                <ListGroup variant= 'flush'>
                    <ListGroup.Item>
                        <h2>Shipping</h2>
                        <p>
                            <strong> Address: </strong> 
                            {cart.shippingAddress.address} , {cart.shippingAddress.city} {' '} {cart.shippingAddress.postalCode} , {' '} {cart.shippingAddress.country}
                        </p>                        
                    </ListGroup.Item>
                    <ListGroup.Item>
                        <h2>Payment Method</h2>
                        <strong>Method: </strong>
                        {cart.paymentMethod}
                    </ListGroup.Item>
                    <ListGroup.Item>
                        <h2>Order Items</h2>
                        {cart.cartItems.length === 0 ? 
                        (<Message>Cart is Empty</Message>): (
                          <ListGroup variant='flush'>
                            {cart.cartItems.map((item,index) => (
                                <ListGroup.Item key={index}>
                                    <Row>
                                        <Col md={1}>
                                            <Image src={item.image} alt={item.name} fluid rounded/>
                                        </Col>
                                        <Col>
                                            <Link to={`/product/${item.product}`}>{item.name}</Link>
                                        </Col>
                                        <Col md={4}>
                                            {item.qty} X ${item.price} = ${(item.qty * item.price).toFixed(2)}
                                        </Col>
                                    </Row>
                                </ListGroup.Item>
                            ))}
                          </ListGroup>  
                        )} 
                    </ListGroup.Item>
                </ListGroup>
            </Col>
            
            <Col md={4}> 
                <Card>
                    <ListGroup variant='flush'>
                        <ListGroup.Item>
                            <h2>Order Summary</h2>
                        </ListGroup.Item>
                        <ListGroup.Item>
                            <Row>
                                <Col>Items</Col>
                                <Col>${cart.itemsPrice}</Col>
                            </Row>
                        </ListGroup.Item>
                        <ListGroup.Item>
                            <Row>
                                <Col>Shipping Price</Col>
                                <Col>${cart.shippingPrice}</Col>
                            </Row>
                        </ListGroup.Item>
                        <ListGroup.Item>
                            <Row>
                                <Col>Tax Pirce</Col>
                                <Col>${cart.taxPrice}</Col>
                            </Row>
                        </ListGroup.Item>
                        <ListGroup.Item>
                            <Row>
                                <Col>Total Price</Col>
                                <Col>${cart.totalPrice}</Col>
                            </Row>
                        </ListGroup.Item>
                        <ListGroup.Item>
                            <Button style={{width: "100%"}} type="button" className="btn-block" disabled={cart.cartItems.length === 0} onClick={placeOrderHandler}>
                                Place Order
                            </Button>
                        </ListGroup.Item>

                    </ListGroup>
                </Card>
            </Col>
        </Row>
    </>
 )
};

export default PlaceOrderScreen;
